    "2015-06-17T01:58:02.906437",nt"name": "nesting-success-of-geese-in-the-coastal-tundra-region-of-the-yukon-kuskokwim-delta-1986-fi",nt"isopen":
    false,nt"url": null,nt"notes": "Goose nesting success on the YK Delta in
    1986 increased over 1984 and 1985. Environmental conditions were close to average
    in spite of a cool and prolonged spring. Predation by arctic fox continued to be
    a major source of nest loss in a large portion of the delta. Although glaucous gulls,
    parasitic jaegers, and mink also contribute to nest loss, the large reduction in
    nest predation at Tutakoke and Kigigak where foxes were trapped supports the potential
    benefits of local reduction in Arctic fox populations.",nt"license_title":
